class Solution {
    func lastVisitedIntegers(_ words: [String]) -> [Int] {
        var nums: [Int] = []
        var result: [Int] = []
        var prevCount = 0

        for word in words {
            if word == "prev" {
                prevCount += 1
                if prevCount <= nums.count {
                    result.append(nums[nums.count - prevCount])
                } else {
                    result.append(-1)
                }
            } else {
                if let num = Int(word) {
                    nums.append(num)
                }
                prevCount = 0
            }
        }

        return result
    }
}
